// Set up smooth scrolling behavior for navigation links
document.addEventListener('DOMContentLoaded', () => {
  // Get the document object
  const doc = wwLib.getFrontDocument();

  // Apply smooth scrolling to the document
  doc.documentElement.style.scrollBehavior = 'smooth';

  // Set up interval to update countdown timer every second
  const updateCountdown = () => {
    // Force re-render of countdown elements
    const countdownDate = variables['332a1e3f-53a7-48d2-85b1-73d7a7dd8a65'];
    const now = new Date();
    const target = new Date(countdownDate);

    // If countdown date has passed, set it to the end of next month
    if (target <= now) {
      const nextMonth = new Date();
      nextMonth.setMonth(nextMonth.getMonth() + 1);
      nextMonth.setDate(0); // Last day of next month
      nextMonth.setHours(23, 59, 59, 999);

      variables['332a1e3f-53a7-48d2-85b1-73d7a7dd8a65'] = nextMonth.toISOString();
    }
  };

  // Initial update
  updateCountdown();

  // Set interval to update every second
  const countdownInterval = setInterval(updateCountdown, 1000);

  // Clean up interval on page unload
  return () => {
    clearInterval(countdownInterval);
  };
});

